import React from "react";

import { Route } from "react-router-dom";

const Admin = ({ match }) => {
	console.log("match:", match);

	return (
		<div>
			<Route to={"${match.url}/"} element={"Hello"} />
			<Route to={"${match.url}/test"} Element={"Test"} />
		</div>
	);
};

export default Admin;
